import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 20, height: 20, viewBox: "0 0 20 20", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M10 2a4 4 0 100 8 4 4 0 000-8z", fill: primaryFill }),
        React.createElement("path", { d: "M5 11a2 2 0 00-2 2c0 1.7.83 2.97 2.13 3.8A9.14 9.14 0 0010 18c1.85 0 3.58-.39 4.87-1.2A4.35 4.35 0 0017 13a2 2 0 00-2-2H5z", fill: primaryFill }));
};
const Person20Filled = wrapIcon(rawSvg({}), 'Person20Filled');
export default Person20Filled;
